import React from 'react';
import "./TextButton.css";
import { Link } from 'react-router-dom';

const TextButton = (text, href) => {
  return (
    <div className="textButton">
      <Link to={href}>
        <button id="textBtn">{text.text}</button>  
      </Link>  
    </div>
  );
}

export default TextButton;
